import { Progress } from "flowbite-react";
import { Progress as ProgressType } from "../../app/types/types";

export default function GroupProgress(props: ProgressType ){
    return (
        <>
            <h6 className="break-words !text-lg h-14 text-center text-2xl font-bold tracking-tight text-gray-900 dark:text-white">
                {props.total}%ss
            </h6>
            <div className='pb-1'><Progress progress={props.english} color='dark'/></div>
            <div className='pb-1'><Progress progress={props.russian} color='dark'/></div>
            <div className='pb-1'><Progress progress={props.spelling} color='dark'/></div>
            <div className='pb-1'><Progress progress={props.auding} color='dark'/></div>
        </>
    )
}
